import React from "react";
import ReactDOM from "react-dom";
import { BrowserRouter, Route, Switch, link } from "react-router-dom";



import logo from './logo.svg';
import png from './upside ground coffee bag.png';
import './App.css';
import login from './login.js';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          <img src= "upside ground logo.jpg" alt ="logo" className ="logo"  />
        </p>
        <a
          className="login"
          href= "login.js"
          target="_blank"
          rel="noopener noreferrer"
          
        >
          login
        </a>
     
        <a
    
          className="signup"
          href= "log in"
          target="_blank"
          rel="noopener noreferrer"
        >
         sign up
        </a>
        <link to = '/login.js'>login</link>
      </header>
      <p>
          <img src= {png} alt ="bag1" className ="bag1"  />
        </p>      
    </div>
  );
}



const rootElement = document.getElementById("root");
    ReactDOM.render(
      <BrowserRouter>
       <Switch>
        <Route exact path="/login.js" component={login} />
      </Switch>
      </BrowserRouter>,
      rootElement
    );



export default App;
